// Simple JavaScript Templating
// John Resig - http://ejohn.org/ - MIT Licensed
var cache = {};

function template(str, data){
  // Figure out if we're getting a template, or if we need to
  // load the template - and be sure to cache the result.
  var fn = cache[str] ||

  // Generate a reusable function that will serve as a template
  // generator (and which will be cached).
    new Function("obj",
      "var p=[],print=function(){p.push.apply(p,arguments);};" +

            // Introduce the data as local variables using with(){}
            "with(obj){p.push('" +

            // Convert the template into pure JavaScript
            str
            .replace(/\n/g, "\\n")
            .replace(/[\r\t]/g, " ")
            .replace(/'(?=[^%]*%>)/g,"\t")
            .split("'").join("\\'")
            .split("\t").join("'")
            .replace(/<%=(.+?)%>/g, "',$1,'")
            .split("<%").join("');")
            .split("%>").join("p.push('")
            + "');}return p.join('');");
  cache[str] = fn;

  // Provide some basic currying to the user
  return data ? fn( data ) : fn;
};

couchapp.date:
function f(n) {    // Format integers to have at least two digits.
    return n < 10 ? '0' + n : n;
}

Date.prototype.rfc3339 = function() {
    return this.getUTCFullYear()   + '-' +
         f(this.getUTCMonth() + 1) + '-' +
         f(this.getUTCDate())      + 'T' +
         f(this.getUTCHours())     + ':' +
         f(this.getUTCMinutes())   + ':' +
         f(this.getUTCSeconds())   + 'Z';
};

// This is a format that collates in order and tends to work with
// JavaScript's new Date(string) date parsing capabilities, unlike rfc3339.
Date.prototype.toJSON = function() {
    return this.getUTCFullYear()   + '/' +
         f(this.getUTCMonth() + 1) + '/' +
         f(this.getUTCDate())      + ' ' +
         f(this.getUTCHours())     + ':' +
         f(this.getUTCMinutes())   + ':' +
         f(this.getUTCSeconds())   + ' +0000';
};

couchapp.path:
// from couch.js
function encodeOptions(options, noJson) {
  var buf = []
  if (typeof(options) == "object" && options !== null) {
    for (var name in options) {
      if (!options.hasOwnProperty(name)) continue;
      var value = options[name];
      if (!noJson && (name == "key" || name == "startkey" || name == "endkey")) {
        value = toJSON(value);
      }
      buf.push(encodeURIComponent(name) + "=" + encodeURIComponent(value));
    }
  }
  if (!buf.length) {
    return "";
  }
  return "?" + buf.join("&");
}

function concatArgs(array, args) {
  for (var i=0; i < args.length; i++) {
    array.push(args[i]);
  };
  return array;
};

function makePath(array) {
  var options, path;

  if (typeof array[array.length - 1] != "string") {
    // it's a params hash
    options = array.pop();
  }
  path = array.map(function(item) {return encodeURIComponent(item)}).join('/');
  if (options) {
    return path + encodeOptions(options);
  } else {
    return path;    
  }
};

function assetPath() {
  var p = req.path, parts = ['', p[0], p[1] , p[2]];
  return makePath(concatArgs(parts, arguments));
};

function showPath() {
  var p = req.path, parts = ['', p[0], p[1] , p[2], '_show'];
  return makePath(concatArgs(parts, arguments));
};

function listPath() {
  var p = req.path, parts = ['', p[0], p[1] , p[2], '_list'];
  return makePath(concatArgs(parts, arguments));
};

function olderPath(info) {
  if (!info) return null;
  var q = req.query;
  q.startkey = info.prev_key;
  q.skip=1;
  return listPath('index','recent-posts',q);
}

function makeAbsolute(req, path) {
  return 'http://' + req.headers.Host + path;
}


function currentPath() {
  path = req.path.map(function(item) {return encodeURIComponent(item)}).join('/');
  if (req.query) {
    return path + encodeOptions(req.query, true);
  } else {
    return path;
  }
}

all.map:
function(doc){
	if(doc.stime && doc.type != "" ) {
		var d = new Date();
		//d.setTime(doc.stime);
		d.setTime(doc.stime+32400000); // fix to JST
		//d.setTime(doc.stime * 1000); // stime is JST +0900 , millisec
		var key = [d.getFullYear(),(d.getMonth()+1),d.getDate(),d.getHours(),d.getMinutes()];

		emit(key, {"stime":doc.stime,"count":1} );
	}
}

all.reduce:
function(keys, values){
	var count = 0;
	var stime = null;
	values.forEach(function(val){
		count += val.count;
		stime = val.stime;
	});
	return {"stime":stime,"count":count};
}

